import React from 'react';
import CardCar from './components/CardCar'
import ModelesPage from './components/ModelesPage'

function App() {
  return (
    <div>
      <ModelesPage/>
      <CardCar model="Mercedes" kilometrage="152000 Km" annee="2016" co2 = "99 g/km" garantie="6 mois" />
      <CardCar/>

    </div>
  );
}

export default App;
